import React from "react"
import styles from "../../styles/pdf/Description"

const Description = ({ data }) => {
  return (
    <View style={styles.container}>
      <Text style={styles.header}>Profile</Text>
      <Text>{data}</Text>
    </View>
  )
}

export default Description
